import React from 'react';
const Piece = (props) => {
  return (
          <div class="image-grid-block">
          <div className = "image-grid-image">
            <img src={props.portfolioItem.thumbnail.url} />
          </div>
            <div>
              <span>{props.portfolioItem.name}</span>
              <span>{props.portfolioItem.caption}</span>
              </div>
            </div>
  );
}
export default Piece;
